//propTypes
import React from "react"

export class Robo extends React.Component{
    render(){
      return(
        <div>
          Firstname:{this.props.fname}<br/>
          Lastname:{this.props.lname}<br/>
        </div>
      )
    }
  }

  Robo.propTypes={
    fname:PropTypes.string,
    lname:PropTypes.string
  }

  Robo.defaultprops={
    fname:"Naveen",
    lname:"konidela"
  }
